const fs = require('fs');
const urlLib = require('urllib');
const request = require('request');



(async () => {

    const fsStream = fs.createReadStream("./assets/mpCode.jpg");
    /**
     * ReadStream
     *
     * readable: true
     * events: end
     * _readableState:
     *
     * */
    fsStream.on('data', function (chunk) {
        console.log(chunk.toString('hex')+'\n\n');
        // 
        // 

    });

    // const requestStream = request({
    //     method: "GET",
    //     url: 'https://wj-blog.oss-cn-beijing.aliyuncs.com/object-name'
    // });
    const requestStream = await request('https://wj-blog.oss-cn-beijing.aliyuncs.com/object-name');
    /**
     * Request
     *
     * readeable: true
     * writeale: false
     *
     * */
    requestStream.on('data', chunk => {
        console.log(chunk.toString('hex') + '\n\n');
        // 
        // ...
        // 
    });

    const { res:  urlLibStream } = await urlLib.request('https://wj-blog.oss-cn-beijing.aliyuncs.com/object-name', {method:'GET', streaming: true});
    /**
     * IncommingMessage
     *
     * connection
     * readable: true
     * req
     * socket
     * events: end
     * _readableState:
     *
     * */
    urlLibStream.on('data', chunk => {
        console.log(chunk.toString('hex') + '\n\n');
        // 
        // ...
        // 
    });
})().catch(e => console.log(e));


